// frontend/src/components/OrgChart.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import '../assets/style.css';

const OrgChart = () => {
    const [employees, setEmployees] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        const fetchEmployees = async () => {
            try {
                const response = await axios.get('http://localhost:5070/api/users/orgchart/active');
                setEmployees(response.data);
            } catch (error) {
                console.error('Error fetching active employees', error);
                setError('Error fetching employee data.');
            } finally {
                setLoading(false);
            }
        };

        fetchEmployees();
    }, []);


    const renderOrgChart = () => {
        if (loading) return <p>Loading...</p>;
        if (error) return <p>{error}</p>;

        const ceo = employees.find(emp => emp.title.toLowerCase() === 'ceo');
        const directors = employees.filter(emp => emp.title.toLowerCase().includes('director'));
        const managers = employees.filter(emp => emp.title.toLowerCase().includes('manager'));
        const others = employees.filter(emp => 
            !emp.title.toLowerCase().includes('ceo') &&
            !emp.title.toLowerCase().includes('director') &&
            !emp.title.toLowerCase().includes('manager')
        );

        const groupedOthers = others.reduce((acc, emp) => {
            if (!acc[emp.groups[0]]) acc[emp.groups[0]] = [];
            acc[emp.groups[0]].push(emp);
            return acc;
        }, {});

        return (
            <div className="org-chart">
                {ceo && (
                    <div className="org-level ceo">
                        <div className="employee">
                            <p>{ceo.firstName} {ceo.lastName}</p>
                            <p>{ceo.title}</p>
                        </div>
                    </div>
                )}
                <div className="org-level directors">
                    {directors.map((director, index) => (
                        <div key={index} className="employee">
                            <p>{director.firstName} {director.lastName}</p>
                            <p>{director.title}</p>
                        </div>
                    ))}
                </div>
                <div className="org-level managers">
                    {directors.map((director) => (
                        <div key={director._id} className="director-group">
                            <h3>{director.title}</h3>
                            {managers.filter(manager => manager.title.toLowerCase().includes(director.title.split(' ')[0].toLowerCase())).map((manager, index) => (
                                <div key={index} className="employee">
                                    <p>{manager.firstName} {manager.lastName}</p>
                                    <p>{manager.title}</p>
                                </div>
                            ))}
                        </div>
                    ))}
                </div>
                <div className="org-level others">
                    {Object.keys(groupedOthers).map((group, index) => (
                        <div key={index} className="group">
                            <h3>{group}</h3>
                            {groupedOthers[group].map((employee, index) => (
                                <div key={index} className="employee">
                                    <p>{employee.firstName} {employee.lastName}</p>
                                    <p>{employee.title}</p>
                                </div>
                            ))}
                        </div>
                    ))}
                </div>
            </div>
        );
    };

    return (
        <div>
            <h2>Org Chart - Active Employees</h2>
            {renderOrgChart()}
            <button onClick={() => navigate('/home')}>Home</button>
        </div>
    );
};

export default OrgChart;
